const Navbar = () => {
  return (
    <nav class="navbar posi">
      <div class="container">
        <h1>Foody</h1>
        <div className="input">
          <label htmlFor="search">Search</label>
          <input type="text" id="search" />
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
